import React from 'react';
import {StyleSheet, Text, View, ScrollView, Image, TouchableWithoutFeedback} from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import restauranteMenu from './RestauranteMenu';
import restaurantes from './Restaurantes';  
import home from './Home';  


const Stack = createStackNavigator();
export default function Cart() {
return(
    <NavigationContainer>
    <Stack.Navigator initialroute='Restaurantes' >
    <Stack.Screen name="Restaurantes" component={restaurantes} />
    <Stack.Screen name="Pratos" component={restauranteMenu} />
    </Stack.Navigator>
    </NavigationContainer>

);
}




const styles = StyleSheet.create({
    image: {
        height: 300,
    },
});
